def checkmate(kx, ky, r1x, r1y, r2x, r2y):
    if r1x in [kx, kx + 1, kx - 1] and r1y in [ky, ky + 1, ky - 1]:
        if r1x != r2x or r1y != r2y:
            return False
    elif r2x in [kx, kx + 1, kx - 1] and r2y in [ky, ky + 1, ky - 1]:
        if r2x != r1x or r2y != r1y:
            return False
    elif kx in [1, 8] and set([r1x, r2x]).issubset(set([kx, kx + 1, kx - 1])):
        return True
    elif ky in [1, 8] and set([r1y, r2y]).issubset(set([ky, ky + 1, ky - 1])):
        return True
    return False

def solution():
    (kx, ky) = list(map(int, input().split()))
    (r1x, r1y) = list(map(int, input().split()))
    (r2x, r2y) = list(map(int, input().split()))
    if checkmate(kx, ky, r1x, r1y, r2x, r2y):
        return 'YES'
    if (r1y == r2y and (kx <= r2x and r1x > r2x or (kx >= r2x and r1x < r2x))) == False:
        if checkmate(kx, ky, kx, r1y, r2x, r2y):
            return 'YES'
    if (r1y == r2y and (kx <= r1x and r2x > r1x or (kx >= r1x and r2x < r1x))) == False:
